import React, { Component } from "react";
//import IndexInfo from "./indexInfo";

const API =
  "https://npdpl9r340.execute-api.us-east-1.amazonaws.com/prod/marketdata/v1/index/HDAI/last";

class indexDetails extends Component {
  constructor() {
    super();
    this.state = {
      constituents: []
    };
  }

  componentDidMount() {
    fetch(API)
      .then(response => response.json())
      .then(data => this.setState({ constituents: data.constituents }));
  }

  //  state = {};
  render() {
    const { constituents } = this.state;

    return (
      <ul>
        {constituents.map(constituents => (
          <li key={constituents.assetd} />
        ))}
      </ul>
    );
  }
}

export default indexDetails;
